##########################################################
### Generate Libraires Holding Peak Data
##########################################################

with open(Nfur, 'w') as input:
    for file in os.listdir(CPF):
        with open(CPF + file, 'r') as temp:
            locator = file[:4]
            if 'RPKM' in file: 
                for line in temp:
                    line = line.rstrip('\n')
                    line = '\t'.join(line.split())
                    line = line.split('\t')
                
                    if line[0] == 'chromosome':
                        pass
                    else:
                        ider = line[3]
                        looper = len(line)
                        hopper = 11
                        Codex[locator][ider] = []
        
                        while hopper < looper:
                            Codex[locator][ider].append(line[hopper])
                            hopper = hopper + 1
                 
                    if locator == 'Nfur' and line[0] != 'chromosome':
                        input.write(line[0] + '\t' + line[1] + '\t' + line[2] + '\t' + line[3] + '\n')       
                    
                        
            if 'AN' in file:
                for line in temp:
                    line = line.rstrip('\n').split('\t')
                
                    if line[0] == 'names':
                        truth = line.index('annotation')
                    else:
                        locator = file[:4]
                        ider = line[0]
                        Minidex[locator][ider] = line[truth]

print('Step 1 Complete')
      
      
##########################################################
### Relate Nfur Peaks to all Other species
##########################################################
                    
for file in os.listdir(Other):
    if Other + file != Nfur and '_final.bed' in file:
        with open(Other + file[:4] + '_inter.bed', 'wt') as sitter:
            subprocess.call(['bedtools', 'intersect', '-wo', '-a', Nfur, '-b', Other + file], stdout=sitter)
        with open(Other + file[:4] + '_inter.bed', 'r') as newly:
            local = file[:4]
            for line in newly:
                line = line.rstrip('\n').split('\t')
                killi = line[3]
                fish = line[7]
                over = float(line[-1])
                start = float(line[1])
                finish = float(line[2])
                size = finish - start
                percent = over/size
                
                if percent >= require:
                    if killi in Ultradex[local].keys():
                        if over > Ultradex[local][killi][1]:
                            Ultradex[local][killi] = [fish, over]
                    else:
                        Ultradex[local][killi] = [fish, over]

print('Step 2 Complete')

##########################################################
### Write all peak data to master files
##########################################################
                    
with open(Nfur, 'r') as last, open(Other + 'Peak_Master_' + str(require) + '.txt', 'w') as out1, open(Other + 'RPKM_Master_' + str(require) + '.txt', 'w') as out2, open(Other + 'Annotate_Master_' + str(require) + '.txt', 'w') as out3:
    out1.write(Header)
    out2.write(binder)
    out3.write(Header)
    
    for line in last:
        line = line.rstrip('\n').split('\t')
        peak = line[3]
        
        peaker = []
        rpkmer = []
        annotator = []
        
        peaker.append(peak)
        rpkmer.append(peak)
        annotator.append(peak)
        annotator.append('NA')
        for item in Codex['Nfur'][peak]:
            rpkmer.append(item)
        
        for entry in Ultradex:
            if peak in Ultradex[entry].keys():
                bridge = Ultradex[entry][peak][0]
                peaker.append(bridge)
                bridge = bridge.split('X')
                bridge = bridge[0]
                
                if bridge in Minidex[entry].keys():
                    ant = Minidex[entry][bridge]
                    annotator.append(ant)
                elif peak in banned:
                    annotator.append('NA')
                else:
                    annotator.append('None')
                
                for item in Codex[entry][bridge]:
                    rpkmer.append(item)
            
            
            elif peak in banned:
                peaker.append('NA')
                annotator.append('NA')
                repper = Checkerdex[entry]
                lenner = 1               
                while lenner <= repper:
                    rpkmer.append('NA')
                    lenner = lenner + 1
                        
            else:      
                peaker.append('None')
                annotator.append('None')
                repper = Checkerdex[entry]
                lenner = 1               
                while lenner <= repper:
                    rpkmer.append('None')
                    lenner = lenner + 1
            
        one = '\t'.join(peaker)
        two = '\t'.join(rpkmer)
        three = '\t'.join(annotator)
        out1.write(one + '\n')
        out2.write(two + '\n')
        out3.write(three + '\n')
            
print('Step 3 Complete')

                        
